import Dashboard from './components/Dashboard';
import * as injectTapEventPlugin from 'react-tap-event-plugin';

// Needed for onTouchTap
// Check this repo:
// https://github.com/zilverline/react-tap-event-plugin
injectTapEventPlugin();

function App() {
  return (
    <div>
      <Dashboard/>
    </div>
  );
}

export default App;
